import { NavLink, useNavigate } from "react-router-dom";

const Navbar = () => {
  const navigate = useNavigate();

  const handleClick = () => {
    navigate("/login");
  };

  return (
    <div className="navbar fixed-top bg-dark justify-content-end">
      <ul className="navbar-nav me-auto mb-2 mb-lg-0">
        <li className="nav-item">
          <NavLink to="/" className="nav-link active">
            Home
          </NavLink>
        </li>
        <li className="nav-item">
          <NavLink to="/register" className="nav-link active">
            Register
          </NavLink>
        </li>
        <li className="nav-item">
          <NavLink to="/series" className="nav-link active">
            Series
          </NavLink>
        </li>
        {/* <li >
          <NavLink to="/search" className="btn btn-outline-success me-2">
            Search
          </NavLink>
        </li> */}
      </ul>
      <div className=" justify-content-end">
        {/* {isAuthenticated ? `Bienvenid@ ${user}!` : "Logueate!"} */}

        <button
          onClick={handleClick}
          className="btn btn-outline-success me-2"
          /* onClick={(e) => (!isAuthenticated ? loginUser(e) : logoutUser(e))} */
        >
          {" "}
          Login
          {/* {isAuthenticated ? "Cerrar Sesi√≥n" : "Ingresar"} */}
        </button>
      </div>
    </div>
  );
};

export default Navbar;
